&lt;p&gt;&lt;a title=&quot;Lateral Plains&quot; href=&quot;http://www.lateralplains.com/&quot; target=&quot;_blank&quot;&gt;Lateral Plains&lt;/a&gt; and the &lt;a title=&quot;Centre for eCommerce & Communications&quot; href=&quot;http://www.cecc.com.au&quot; target=&quot;_blank&quot;&gt;Centre for eCommerce and Communication&lt;/a&gt; were engaged by Moorabool Shire and Multimedia Victoria to review ICT in the Moorabool region.  The study was completed in the period between April 2009 and April 2010.&lt;/p&gt;
